import React from "react";

import "../node_modules/bootstrap/dist/css/bootstrap.min.css";

const App = () => {
  return (
    <>
      <h1>welcome to my channel</h1>
      <div class="container">
        <div class="container">
          <div class="row">
            <div class="col-sm">One of three columns</div>
            <div class="col-sm">One of three columns</div>
            <div class="col-sm">One of three columns</div>
          </div>
        </div>
      </div>
    </>
  );
};

export default App;
